import React, { Component, createContext } from 'react'
//import '../App.css'


class Header extends React.Component {
    constructor(props) {
      super(props);
    
      this.state = {value: 'Bangalore'};
  
      this.handleChange = this.handleChange.bind(this);
      this.handleSubmit = this.handleSubmit.bind(this);
    }


    handleChange(event) {
        this.setState({value: event.target.value});
      }
    
      handleSubmit(event) {
        alert('Your City is: ' + this.state.value);
        console.log("hello");
        console.log("hello");
       
        event.preventDefault();
      }
   
  
    render() {
      return (
        <header>
        <div class="main">
            
              
                <button><a href="#"><img src={'images/carwalelogo.png'} width="30" height="30" /></a></button>
                <button  onClick={this.handleSubmit}><a href="#"><img src={'images/locationLogo.png'} width="30" height="30" /></a></button>
                
           
        </div>
    </header>
      );
    }
  }
  



export default Header;
